<?php $__env->startSection('content'); ?><p>They face their first elimination round on Tuesday.</p>

<p>And so the new crop of Dancing With The Stars contestants were back at rehearsals again on Thursday in LA.</p>

<p>Chrishell Stause appeared excited as she arrived at the studio in a fetching ensemble of pale blue cashmere weather and black wet look skirt.</p>

<p>Stylish: Chrishell Stause appeared excited as she arrived at Dancing With The Stars rehearsals in LA Thursday in a fetching ensemble of pale blue cashmere weather and black wet look skirt</p>

<p>The Selling Sunset reality star, 39, carried her dance clothes in a large cloth tote in one hand and had a black designer purse in her other.</p>

<p>She wore black heels and her long hair was loose and sleekly styled.</p>

<p>Chrishell is paired with dance pro Gleb Savchenko, 37, in season 29 of the ABC dance competition.</p>

<p>The two performed a tango on Monday night's season premiere which left judges Carrie Ann Inaba, Bruno Tonioli and Derek Hough somewhat unimpressed. They gave the couple a score of just 13 points out of a possible 30.</p>

<p>Cute: The Selling Sunset reality star, 39, who stepped out in black heels, carried her dance clothes in a large cloth tote in one hand and had a black designer purse in her other</p>

<p>High energy: Disney Channel star Skai Jackson seemed raring to go, appearing to be dancing along to tunes via her earbuds as she headed to rehearsals</p>

<p>Ready to rehearse: The 18-year-old actress, who brought some fast food with her, was dressed casually in a gray hoodie and dance shorts along with white socks and trainers</p>

<p>Disney Channel star Skai Jackson seemed raring to go, appearing to be dancing along to tunes via her earbuds as she headed to rehearsals.</p>

<p>The actress, 18, and partner Alan Bersen were awarded 21 points for their cha cha cha, tying with Justina Machado and Sasha Farber for the highest score in episode one.</p>

<p>Skai, who brought some fast food with her, was dressed casually in a gray hoodie and dance shorts along with white socks and trainers.</p>

<p>Hats off: Backstreet Boys singer A J McLean, 42, was unmissable in a colorful hoodie and bright blue designer sneakers and he had three hats perched on top of his head</p>

<p>Loaded up: He also had his hands full, carrying a camo backpack over one shoulder and a beverage in each hand along with a small black case</p>

<p>Backstreet Boys singer A J McLean was unmissable in a colorful hoodie and bright blue designer sneakers.</p>

<p>The 42-year-old, who is paired with pro Cheryl Burke, had three hats perched on top of his head and wore a black cloth face mask.</p>

<p>He also had his hands full, carrying a camo backpack over one shoulder and a beverage in each hand along with a small black case. </p>

<p>He and Burke go into round two with 18 points from the judges for their jumping jive performance. </p>

<p>Serious: Netflix's Cheer star Monica Aldama put on a brave face as she faced cameras on the same day that 21-year-old Jerry Harris from her docuseries squad was arrested and charged with producing child pornography</p>

<p>Focused on the show: The Navarro College, Texas, co-ed cheerleading coach attended her dance session wearing a pink tank top over a black sports bra and black leggings</p>

<p>Meanwhile, Netflix's Cheer star Monica Aldama put on a brave face as she faced the cameras on the same day that 21-year-old Jerry Harris from her docuseries squad was arrested and charged with producing child pornography.</p>

<p>The Navarro College, Texas, co-ed cheerleading coach attended her dance session wearing a pink tank top over a black sports bra and black leggings.</p>

<p>She carried her stuff in a large dark red bag and kept a face mask on as she headed into the studio. </p>

<p>Monica and dance pro Val Chmerkovskiy put on a show with a foxtrot on Monday night and got 18 points.</p>

<p>Other contestants on season 29 are Tiger King star Carole Baskin, The Bachelorette's Kaitlyn Bristowe, former NFL tight end Vernon Davis, actress Anne Heche, TV host Jeannie Mai, actor Jesse Metcalfe, rapper Nelly, former NBA power forward Charles Oakley, Catfish host Nev Schulman and ice skater Johnny Weir. </p>

<p>Headed to the studio: Rapper Nelly, who is also a contestant on season 29 of the ABC dance competition, was also seen arriving to practice his moves</p>
